      this.setState({
        item: data,
        isLoaded:true,
      });
  }

  render() {

    var { isLoaded, item } = this.state;
    console.log(item);

    var pages = [];


    pages.push({
      blocks:[],
      coordinate: {
        x: 572,
        y: 700
      }
    });

    return (
      <Page fullTextAnnotation={item.fullTextAnnotation} />
    );
  }
}

export default App;
